import React from "react";
import "./DietaryIcon.css"; // Archivo CSS para estilos personalizados.

// Rutas relativas a la carpeta de íconos
const dietaryIcons = {
  // Restricciones Dietéticas
  vegetarian: "src/icons/vegetarian.png", // FET
  vegan: "src/icons/vegan.png", // FET
  pescatarian: "src/icons/contains_fish.png", // FET
  ketogenic: "src/icons/keto.png", // FET
  paleo: "src/icons/paleo.png", // FET
  primal: "src/icons/primal.png", // FET
  /*lowFODMAP: "icons/low-fodmap.png",*/
  whole30: "src/icons/whole30.png",
  /*highProtein: "icons/high-protein.png",*/
  lowCarb: "src/icons/low_carb.png", // FET
  lowFat: "src/icons/low_fat.png", // FET
  sugarConscious: "src/icons/sugar_conscious.png", // FET

  // Intolerancias y Alérgenos
  glutenFree: "src/icons/gluten_free.png", // FET
  /*dairyFree: "icons/dairy-free.png",*/
  eggFree: "src/icons/egg_free.png", // FET
  peanutFree: "src/icons/no_nuts.png", // FET
  treeNutFree: "src/icons/tree-nut-free.png",
  soyFree: "src/icons/soy_free.png", // FET
  fishFree: "src/icons/fish_free.png", // FET
  /*shellfishFree: "icons/shellfish-free.png",*/
  wheatFree: "src/icons/wheat_free.png", // FET
  sesameFree: "src/icons/sesame_free.png", // FET
  sulfiteFree: "src/icons/sulfit_free.png", // FET
  celeryFree: "src/icons/celery_free.png", // FET
  mustardFree: "src/icons/mustard_free.png", // FET
  lupinFree: "src/icons/lupin_free.png", // FET
  molluskFree: "src/icons/mollusk_free.png", // FET

  // Información Nutricional
  /*calories: "icons/calories.png",
  carbohydrates: "icons/carbohydrates.png",
  proteins: "icons/proteins.png",
  fats: "icons/fats.png",
  cholesterol: "icons/cholesterol.png",
  fiber: "icons/fiber.png",
  sugar: "icons/sugar.png",*/

  // Ícono genérico
  //default: "icons/default.png",
};

const DietaryIcon = ({ diet }) => {
  const icon = dietaryIcons[diet] || dietaryIcons.default; // Ícono por defecto si no se encuentra el especificado.
  return (
    <div className="dietary-icon">
      <img src={icon} alt={diet} className="icon-image" />
      <span>{diet}</span>
    </div>
  );
};

export default DietaryIcon;
